import styled from 'styled-components';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import Slider from 'react-slick';

const ImgSlider = (props) => {
    const Settings={
        dots:true,
        infinite:true,
        speed:500,
        slideToShow:1,
        slideToScroll:1,
        autoplay:true,

    }
    return(
           <Slider {...Settings}>
               <div>
                   <h3>1</h3>
               </div>
               <div>
                   <h3>2</h3>
               </div>
           </Slider>

    )
}

export default ImgSlider;
